import React from 'react'
import Header from './header';
import Contact from './contact';
// import About from './about';
// import Projects from './projects';
import './main.css'
import { Transition } from "react-transition-group";


const AComponent = ({ in: inProp }) => (
    <Transition in={inProp} timeout={500}>
        {state => (
            <div>
                I am {state}
            </div>
        )}
    </Transition>
);


const Main = ({ headerToggle, headerButtonToggled, headerButton }) => {

    if (headerButton === "Projects") {
        return (
            <div className="main-wrapper">
                <AComponent in={headerToggle} />
                <div className="page-header">
                    <Header
                        headerToggle={headerToggle}
                        headerButtonToggled={headerButtonToggled}
                    />
                </div>
                <div className="center-element">
                    <Contact />
                </div>
            </div>
        )

    }

    if (headerButton === "Projects") {
        return (
            <div className="main-wrapper">
                <header className="page-header">
                    <Header headerButtonPressed={headerButton, headerButtonPressed} />
                </header>
                <div className="center-element">
                    <Projects />
                </div>
            </div>
        )
    }

    return (
        <div className="main-wrapper">
            <header className="page-header">
                <Header headerButtonPressed={headerButtonPressed} />
            </header>
            <div className="center-element">
                <About />
            </div>
        </div>
    )
}

export default Main
